import './events.css';

const AttendEvent = () => { 


    return (
        <>
        <div className= "attendevent">
        <div className = "attend-container">

            <div className = "attend-card">
                <div className = "attend-card-row">
                    <img src= {Konnect} />
                </div>
                <div></div>
            </div>
